content:
tem que se pregar respeito sim, mais antes tem que ser pregado a justiça, que é a Biblia, daqui a pouco a Biblia terá algumas paginas arrancadas ou mudadas só para que seja dito, só o que o povo quer escutar, a Biblia é a palavra da verdade e da justiça, e quem acrescenta tira ou muda qualquer coisa isto indo contra ela, e isso esta acontecendo hoje, para se dar bem com os fieis ou com o mundo, e outra coisa;
*EXISTEM ATEUS, CATÓLICOS, EVANGELICOS, SATANISTAS, UBANDISTAS,, ESPIRITAS QUE FAZEM O MAL E VICE-VERSA, RESPEITE A RELIGÃO DO PROXIMO.
CRISTIANISMO É SEGUIR A PALAVRA CORRETA SEM MEDO DE ENFRENTAR AS CONSEQUENCIAS DAS PESSOAS OU POLITICOS.

Com a ajuda do STF e do Ministro Celso de Mello, eu descobri porque os "embargos infringentes" têm esse nome!
Primeiro, são embargos (obstáculos, impedimentos) à execução da justiça em tempo hábil, uma beleza em matéria de protelação ad aeternum;
Depois, "infringentes", porque infringem o bom senso, infringem o princípio da razoabilidade e, no caso concreto, infringem A DECÊNCIA!
